import React from 'react';
import ReactDOM from 'react-dom';
import App from './components/app/App';
import MarvelServices from './services/MarvelServices';
import './style/style.scss';

//Create of class instance 
const marvelService = new MarvelServices(); // this variable will store the descedant of this class
// start rhis component
// givr array and show only names
marvelService.getAllCharacters().then(res => res.data.results.forEach(item => console.log(item.name)));
//marvelService.getCharacters(1011052).then(res => console.log(res));

